import { HttpClient } from "../../utils/HttpClient";

const ROTA_ALMOXARIFADO = "/almoxarifado/material";

const MATERIAL_TIPO = {
    tipo: "",
}

const state = {
    materialTipo: {...MATERIAL_TIPO},
    materialTipo: []
}

const actions = {
    getMaterialTipo: ({commit}) => {
        HttpClient.GET(ROTA_ALMOXARIFADO).then((resposta) => {
            commit("setMaterialTipo", resposta.data)
        })
    },
    criarMaterialTipo: ({commit, state}) => {
        HttpClient.POST(ROTA_ALMOXARIFADO, state.materialTipo).then((resposta) => {
            commit("addMaterialTipo", resposta.data);
        })
    }
}

const mutations = {
    setMateriais: (state, materiais) => {
        state.materialTipo = materialTipo;
    },
    addMaterial: (state, material) => {
        state.materialTipo.push(materialTipo);
    }
}

export default {
    state,
    actions,
    mutations
}
